import React, { useState, useEffect } from 'react';
import Header from '../components/Header';
import RequisitionFood from '../services/Requisitions';

export default function Comidas() {
  const [resultado, incResult] = useState([]);
  useEffect(() => {
    RequisitionFood().then((response) => incResult(response));
  }, []);
  console.log(resultado);
  return (
    <div data-testid="comida">
      <Header />
      <div>
        {
          resultado.map((elem))
        }
      </div>
    </div>
  );
}
